import React from 'react';

function HomeButton(props){

    const goHome = () => {
        props.history.push("/");
    }

    return(
        <div class="divHomeBtn" onClick={goHome}>
            <i class="fas fa-home"></i>
        </div>
    )
}

export default HomeButton;
